let Prefixer=require("./prefixer");class AtRule extends Prefixer{add(e,r){let t=r+e.name;if(e.parent.some(r=>r.name===t&&r.params===e.params))return;let s=this.clone(e,{name:t});return e.parent.insertBefore(e,s)}process(e){let r=this.parentPrefix(e);for(let t of this.prefixes)r&&r!==t||this.add(e,t)}}module.exports=AtRule;